  [],\n\t\"revision_timestamp\": \"2016-01-01T13:40:36.235480\",\n\t\"name\": \"marsh-and-water-management-plan-montezuma-national-wildlife-refuge-1987\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Water management facilities at Montezuma
  National Wildlife Refuge were constructed nearly 50 years ago. The original design
  had a myriad of problems that have since worsened and now severely limit the management
  of water. These problems have combined to significantly alter the structure of marsh
  plant communities and reduce their productivity and carrying capacity for marsh
  dwelling wildlife. This plan will provide a guide for the seasonal operation of
  existing facilities and an organized approach to future major rehabilitation and
  development. The plan addresses in specific detail those aspects of management that
  can be addressed with existing operational funds and those aspects of construction
  and rehabilitation for which funds have been committed.\",\n\t\"license_title\":
